import { ProductsProvider } from 'context';
import React from 'react';

export const App: React.FC = () => {
  return (
    <div>
      <ProductsProvider>
        <Switch>
          <Route exact path="/" render={(props) => <Products {...props} />} />
          <Route exact path="/cart" render={(props) => <Cart {...props} />} />
        </Switch>
      </ProductsProvider>
    </div>
  );
};
